import {Grid} from "@material-ui/core";

export default function Footer() {
    return (
        <footer>
            <Grid container>
                <Grid item xs>
                    <h5>Translation-Dictionary</h5>
                </Grid>
                <Grid item xs className="alignRight" style={{paddingRight: 10}}>
                    <h5>AXA</h5>
                </Grid>
            </Grid>
        </footer>
    );
}
